n",""],["GQ926890",true,34669,37620,"ADI58632.1","asuB1","5-Enolpyruvylshikimate-3-phosphate synthase/CHC-CoA ligase","Precursor biosynthesis","N/A","Knock-out","The asuB1 mutant failed to produce asukamycin A1, but titers of the asukamycin congeners A2A7 were increased 3-fold compared with the wild type strain. Three new compounds, A8, B8, and C8, were accumulated."],["GQ926890",true,37663,37917,"ADI58633.1","asuC5","Asukamycin KSIII associated ACP","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,37928,39013,"ADI58634.1","asuC4","Asukamycin ketosynthase III","Scaffold biosynthesis","N/A","Knock-out","The asuC3/C4 mutant only retained 0.9% asukamycin A1 and 30.0% congeners A2A7 relative to the wild type strain yield. The trace asukamycin A1 possibly results from the functional complementation by the cellular FabH of fatty acid biosynthesis."],["GQ926890",true,39010,40026,"ADI58635.1","asuC3","Asukamycin ketosynthase III","Scaffold biosynthesis","N/A","Knock-out","The asuC3/C4 mutant only retained 0.9% asukamycin A1 and 30.0% congeners A2A7 relative to the wild type strain yield. The trace asukamycin A1 possibly results from the functional complementation by the cellular FabH of fatty acid biosynthesis."],["GQ926890",true,40108,40917,"ADI58636.1","AsuC2","Arylamine N-acyltransferase","Scaffold biosynthesis","N/A","Knock-out","The production of asukamycin was completely blocked in the asuC2 mutant. Instead, the N-acetylated compounds A8, B8, and C8 were accumulated."],["GQ926890",true,41274,41729,"ADI58637.1","asuC6","Thioesterase","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,41746,42303,"ADI58638.1","asuE2","Flavin reducatse","Tailoring","Reduction","Activity assay","The asuE2 mutant produced asukamycin A1 in considerably lower yield than the wild type strain but accumulated major amounts of the protoasukamycins C1C5."],["GQ926890",true,42365,43069,"ADI58639.1","asuC7","Ketoreductase","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,43147,43431,"ADI58640.1","asuC10","Unknown","Unknown","N/A","N/A",""],["GQ926890",true,43428,43880,"ADI58641.1","asuC9","Acyl dehydratase","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,43877,44335,"ADI58642.1","asuC8","Acyl dehydratase","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,44332,45747,"ADI58643.1","asuA2","3,4-AHBA carboxyl group adenylation","Activation / processing","N/A","Activity assay","The asuA2 mutant failed to produce any asukamycins but accumulated 3,4-AHBA."],["GQ926890",true,45867,46985,"ADI58644.1","asuA1","3,4-AHBA synthase","Precursor biosynthesis","N/A","Knock-out","Neither 3,4-AHBA nor asukamycin were detected in the cultures of asuA1 mutants."],["GQ926890",true,47448,49043,"ADI58645.1","asuD1","Amide synthase","Precursor biosynthesis","N/A","Knock-out","All of the asuD1, D2, and D3 mutants failed to produce asukamycin but accumulated a new set of metabolites, A1aA5a, which carry a free carboxyl group in place of the amide-linked C5N moiety of A1A5, respectively."],["GQ926890",true,49040,50269,"ADI58646.1","asuD2","2-Oxoamine synthase","Precursor biosynthesis","N/A","Knock-out","All of the asuD1, D2, and D3 mutants failed to produce asukamycin but accumulated a new set of metabolites, A1aA5a, which carry a free carboxyl group in place of the amide-linked C5N moiety of A1A5, respectively."],["GQ926890",true,50506,51912,"ADI58647.1","asuD3","5-Aminolevulinate CoA ligase","Precursor biosynthesis","N/A","Knock-out","All of the asuD1, D2, and D3 mutants failed to produce asukamycin but accumulated a new set of metabolites, A1aA5a, which carry a free carboxyl group in place of the amide-linked C5N moiety of A1A5, respectively."],["GQ926890",true,51995,53110,"ADI58648.1","asuE3","4-Hydroxyprotoasukamycin epoxidase","Tailoring","Oxidation","Activity assay","The asuE3 mutant fails to produce asukamycin. The asuE3 mutant accumulates 4-hydroxyprotoasukamycin."],["GQ926890",true,53157,53879,"ADI58649.1","asuC14","Ketosynthase I/II","Scaffold biosynthesis","N/A","Knock-out","The asuC13 mutant failed to produce any asukamycins and accumulated 3,4-AHBA."],["GQ926890",true,53935,55116,"ADI58650.1","asuC13","Ketosynthase I/II","Scaffold biosynthesis","N/A","Sequence-based prediction",""],["GQ926890",true,55118,55381,"ADI58651.1","asuC12","3,4-AHBA carrier protein","Activation / processing","N/A","Activity assay","The asuC11/C12 mutant failed to produce asukamycin but accumulated 3,4-AHBA."],["GQ926890",true,55378,55653,"ADI58652.1","asuC11","KSI/II associated ACP","Scaffold biosynthesis","N/A","Knock-out","The asuC11/C12 mutant failed to produce asukamycin but accumulated 3,4-AHBA."],["GQ926890",true,55734,56570,"ADI58653.1","asuA3","Condensation of L-aspartate-4-semialdehyde and dihydroxyacetone phosphate","Precursor biosynthesis","N/A","Knock-out","Neither 3,4-AHBA nor asukamycin were detected in the cultures of asuA3 mutants."],["GQ926890",true,56829,57611,"ADI58654.1","asuC15","Type II thioesterase","Activation / processing","N/A","Knock-out","The asuC15 mutant produced a normal amount of asukamycin A1, yet the yield of the congeners A2A7 was significantly reduced."],["GQ926890",true,57721,59259,"ADI58655.1","asuM1","Asukamycin exporter","Transport","N/A","Sequence-based prediction",""],["GQ926890",true,59539,60303,"ADI58657.1","asuR5","Transcriptional regulation","Regulation","N/A","Sequence-based prediction",""],["GQ926890",true,60425,61579,"ADI58656.1","asuH1","Hypothetical","Unknown","N/A","N/A",""],["GQ926890",true,61590,62432,"ADI58658.1","asuR6","Transcriptional regulation","Regulation","N/A","Sequence-based prediction",""]],"bgc_id":"BGC0000187","tablename":"gene_info","version":"2"}', 2);
